import axios from 'axios';

const KEY = 'AIzaSyCSPzW35rTNCAj6VAkLuwxw5HO-WGATgl0';
// Playlist id =  PLIoBOkqHphxahq2n1FmfGqjRxCR55FnHV
//called in Videos.js
//
export default axios.create({
	baseURL: 'https://www.googleapis.com/youtube/v3',
	params: {
		part: 'snippet',
		playlistId: 'PLillGF-RfqbbI5_XFuidhe3EE7bej5T_y',
		key: KEY
	}
});
